 @user-cv4tz8zy5i  Desfalcado aonde gênio 😒
teve algumas ausência mas mesmo assim continua sendo Vasco
e pronto!

 @reginaldodasilvareginaldod1620  Como assim? O Ramón Diaz pelo Al-Hilal eliminou o Flamengo do mundial, eu sei que estavam com o Vitor Pereira mas não! Nós estávamos na lanterna praticamente rebaixados, agora nós só estamos entrando e saindo da zona, eu li hoje que o Vasco precisa de 46 pontos pra não cair e estamos com 31, temos que conquistar 15 pontos e isso vai ser fácil!
Seria maluquice se o Vasco demitisse esse baita de técino que aguentou o Flamengo de Tite, aguentou o Grêmio embalado e o Vasco quase rebaixado e que, ganhou de simplesmente 4 x 2 do FLUMINENSE E 5 X 1 DO CORITIBA!
Se o Vasco trocar de técnico vai cair sim, porque dificilmente ele vai encontrar um técnico que aguente e, muito mais difícil ainda um que queira ir pro Vasco!

 @lucianodesouza10  Tamo junto 👊😎
independentemente do time que torcemos.
Mas você continua sendo meu amigo 👍
